import React, {Component} from 'react';

class DocumentIndex extends Component {
    constructor(props){
        super(props);
    }

    render(){
        return(
            <div className='col-md-12 igr-3step-doc-index mt-4'>
                <div className='igr-3step-doc-index-table'>
                    <div className='row '>
                        <div className='col-md-6 p-0'>
                            {this.props.column1_data.map((val,indx)=><div key={'column1'+indx} className='row  mt-3'>
                                <div className='col-md-6 doc-index-table-title'>
                                    <label>{val.title}</label>
                                    <span>:</span>
                                </div>
                                <div className='col-md-6 doc-index-table-data'>
                                    <span>{val.data}</span>
                                </div>
                            </div>)}
                        </div>
                        <div className='col-md-6 p-0'>
                            {this.props.column2_data.map((val,indx)=><div key={'column1'+indx} className='row  mt-3'>
                                <div className='col-md-6 doc-index-table-title'>
                                    <label>{val.title}</label>
                                    <span>:</span>
                                </div>
                                <div className='col-md-6 doc-index-table-data'>
                                    <span>{val.data}</span>
                                </div>
                            </div>)}
                        </div>
                    </div>

                </div>
            </div>)
    }
}

export default DocumentIndex;
